	add("canard", "{\"term\":\"canard\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027canard\u0027 (duck) {{rel-top|etymology note}}The primary English meaning of \u0026quot;canard\u0026quot; comes from the Medieval French expression ‚ÄúVendre des canard √† moiti√©.‚Äù The meaning literally is ‚Äúto sell ducks by half.‚Äù It is actually the punch line to a joke. Eventually the punch line came to stand for the joke and then finally the word alone stood for the whole concept. The story is that a duck seller is successful and contented being the only duck seller on the street and he sells his ducks for eight francs each. A new duck seller moves in across the street who steals all the business by offering his ducks for seven francs each. Then a price war ensues, back and forth, until the new duck seller is down to three francs for a duck. The original duck seller is beside himself with worry and frustration, but finally he puts up a big sign that says, ‚ÄúTwo francs‚Äù and then in small print at the bottom ‚Äúfor half a duck.‚Äù Thus, to sell the ducks by half meant to trick people with something that was literally true, but misleading. It has this same metaphorical meaning in French. Now in English, it simply means anything that is deliberately misleading, a fraud.{{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A false or misleading report or story, especially if deliberately so\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027The New Yorker\u0027, 29 August, page 78\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It‚Äôs a cinch, now that Spurling has cleared away a century‚Äôs worth of misapprehensions and \u0027\u0027canards\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"date\u003d20 August passage\u003d[W]hen a spokesman recently stood by his statement that Jews used the blood of non-Jewish children for their matzos\u0026amp;nbsp;‚Äì one of the oldest anti-Semitic \u0027\u0027canards\u0027\u0027 around\u0026amp;nbsp;‚Äì European elites were largely silent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of aircraft in which the primary horizontal control and stabilization surfaces are in front of the main wing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any small winglike structure on a vehicle, usually used for stabilization\", \"priority\":6}]}, \"synonyms\":{}}");

