	add("canopy", "{\"term\":\"canopy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027canope\u0027 from Latin {{m|la|c≈çn≈çpƒìum||curtain}} (ultimately from Ancient greek (to 1453) \u0027Œ∫œâŒΩœâœÄŒµ·øñŒøŒΩ\u0027 (\u0027konopeion\u0027)), through \u0027canopeum\u0027 or possibly Old French \u0027conope\u0027 \u0027conop√©\u0027 (compare modern French \u0027canap√©\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A high cover providing shelter, such as a cloth supported above an object, particularly over a bed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"golden \u0027\u0027canopies\u0027\u0027 and beds of stat\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any overhanging or projecting roof structure, typically over entrances or doors\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The zone of the highest foliage and branches of a forest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In an airplane, the transparent cockpit cover\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In a parachute, the cloth that fills with air and thus limits the falling speed\", \"priority\":7}]}, \"synonyms\":{}}");

