	add("cantaloupe", "{\"term\":\"cantaloupe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027cantaloup\u0027 from Italian \u0027cantalupo\u0027 (a place name), after a former Papal summer estate near Rome, where the melons were first grown after being introduced to Europe.\u0026lt;ref\u0026gt;\u0026quot;[http://www.etymonline.com/index.php?allowed_in_frame\u003d0\u0026amp;search\u003dcantaloupe\u0026amp;searchmode\u003dnone cantaloupe]\u0026quot;, entry in Online Etymology Dictionary.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of melon, ; also known as\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of melon, with sweet orange flesh and a rough skin resembling netting; also known as muskmelon or rockmelon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An orange colour, like that of cantaloupe flesh\", \"priority\":3}]}, \"synonyms\":{}}");

