	add("canteen", "{\"term\":\"canteen\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027cantine\u0027 from Italian \u0027cantina\u0027 which is either from Gaulish or a derivation of Latin \u0027canto\u0027 (corner) denoting the location for liquor storage.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small cafeteria or snack bar, especially one in a military establishment, school, or place of work\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A temporary or mobile caf√© used in an emergency or on a film location etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A box with compartments for storing eating utensils, silverware etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A military mess kit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A water bottle used by a soldier or camper\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cantharides", "{\"term\":\"cantharides\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a genus of coleopterous insects, formerly also taken to include aphids\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027\u0027Cantharides\u0027\u0027\u0027 have some part in them, which by a contrarietie of nature serveth as an antidot or counterpoison against their poison\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Spanish fly, a vesicant extracted from the beetle (alternatively classified \u0027Cantharis vesicatoria\u0027), popularly held to have aphrodisiac properties\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, Hope Mirrlees, \u0027Lud-in-the-Mist\u0027, Ch.26\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I can make the most subtle sauces yield up their secret--whether it be white arsenic, rosalgar, mercury sublimate, or \u0027\u0027cantharides\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, Anthony Burgess, \u0027Nothing Like The Sun\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Speaking her name, it was as if he spake pure \u0027\u0027cantharides\u0027\u0027. ‚ÄòQuick,‚Äô she panted. ‚ÄòThere is time before they are all about. Again\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Will Self, \u0027Cock and Bull\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"It‚Äôs lucky that Carol had taken the precaution of obtaining some \u0027\u0027cantharides\u0027\u0027; without them the evening might have been a dead loss\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 612\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Basically Louis\u0027s drug dealer and pimp, Richelieu, known for opium recipes to fit all occasions, is also credited with the introduction into France of the \u0027\u0027cantharides\u0027\u0027, or Spanish fly\", \"priority\":11}]}, \"synonyms\":{}}");

