	add("cantle", "{\"term\":\"cantle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From \u0027\u0027 Old french (842-ca. 1400) \u0027chantel\u0027 (Modern French \u0027chanteau\u0027 , from \u0027\u0027 diminutive of Latin \u0027cantus\u0027 (corner)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A splinter, slice, or sliver broken off something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"him thought no worship to have a knight at such avail, he to be on horseback and he on foot, and so he alighted and dressed his shield unto Arthur. And there began a strong battle with many great strokes, and so hewed with their swords that the \u0027\u0027cantels\u0027\u0027 flew in the fields, and much blood they bled both, that all the place there as they fought was overbled with blood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;small\u0026gt;\u0026amp;bull\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"hym thought no worship to haue a knyght at suche auaille he to be on horsbak and he on foot and so he alyght \u0026amp; dressid his sheld vnto Arthur \u0026amp; ther begƒÅ a strong bataille with many grete strokes / \u0026amp; soo hewe with her swerdes that the \u0027\u0027cantels\u0027\u0027 flewe in the feldes / and moche blood they bledde bothe / that al the place there as they faught was ouer bledde with blood\u0026lt;/small\u0026gt;\u0026lt;!--Prior quote:ther begƒÅ a strong bataille with many grete strokes, \u0026amp; soo hewe with her swerdes that the \u0027\u0027cantels\u0027\u0027 flewe in the feldes, and moche blood they bledde both--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Act III, Scene i\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"See how this river comes me cranking in, / And cuts me from the best of all my land / A huge half-moon, a monstrous \u0027\u0027cantle\u0027\u0027 out\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1600\u0027\u0027, (tr.), The \u0027\u0027 of , Book VI, xlviii\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Their armors forged were of metal frail; / On every side thereof huge \u0027\u0027cantles\u0027\u0027 flies; / The land was strewed all with plate and mail, / That on the earth, on that their warm blood lies\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In one \u0027\u0027cantle\u0027\u0027 of his law\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The raised back of a saddle\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, ‚ÄòThe Arrest of Lieutenant Golightly‚Äô, \u0027\u0027, Folio 2005, p.93\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He recognised a horse when he saw one, and could do more than fill a \u0027\u0027cantle\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Next day, he returned with a camel-saddle of equal beauty, the long brass horns of its \u0027\u0027cantles\u0027\u0027 adorned with exquisite old Yemeni engraving\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The traps were packed in the splitwillow basket that his father wore with the shoulderstraps loosed so that the bottom of the basket carried on the \u0027\u0027cantle\u0027\u0027 of the saddle behind him\", \"priority\":15}]}, \"synonyms\":{}}");

