	add("cantrip", "{\"term\":\"cantrip\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin {{unk.|en}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spell or incantation; a trifling magic trick\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Kyril Bonfiglioli, \u0027Something Nasty in the Woodshed\u0027 (Penguin 2001, p. 422\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For one thing, I\u0027ve no intention of distributing \u0027\u0027cantrips\u0027\u0027 and costly crucifixes to every rapable woman in the Parish of St Magloire\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Anthony Burgess, \u0027The Kingdom Of The Wicked\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And when I say now the power of the name Jesus makes you whole, I indulge in no petty mountebank‚Äôs \u0027\u0027cantrips\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, James Patterson and Gabrielle Charbonnet, \u0027Witch and Wizard\u0027 (Little, Brown and Company 2009, p. 148\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But it sounds to me like you\u0027re in a totally different category. Not garden-variety \u0027\u0027cantrip\u0027\u0027 stuff\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A wilful piece of trickery or mischief\u0026lt;ref\u0026gt;Chambers Dictionary, 1998, s.v.\u0026lt;/ref\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

	add("canuck", "{\"term\":\"canuck\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"German\", \"English\", \"French\", \"hawaiian\", \"Inuktitut\", \"laurentian\"], \"text\":\"1835 \u0027Kanuk\u0027 (US), 1849 \u0027canuck\u0027 (Canadian), origin {{unk.|en}}.{{rel-top|theories}}Several dictionaries simply state that it is an alteration of \u0027\u0027 or \u0027\u0027 More than one theory holds that the name began as an informal self-appellation by an early Canadian minority, and later acquired a national identity. A few sources explain the ending as coming from Inuktitut \u0027inuk\u0027 (man, person) from \u0027chinook\u0027 () or another Canadian Aboriginal ending like \u0027\u0027 () \u0027\u0027 () or \u0027\u0027 () Another theory is that the name is from the surname \u0027connaught\u0027 () used as a French-Canadian nickname for the Irish. Yet another speculates that the origin is Laurentian \u0027kanata\u0027 (village) which is also the origin of \u0027\u0027 It has also been thought to come from Iroquoian \u0027canuchasa\u0027 () German \u0027\u0027 (genug von canada) or French \u0027\u0027 (quelle canule) Since 1975, a number of linguists have come to believe that the name probably comes from Hawaiian \u0027kanaka\u0027 (man) a self-appellation of indentured colonial canoeman|canoemen and Hawaiian sailors working off the Pacific Northwest, Arctic, and New England coasts. The term may have come to English through French \u0027canaque\u0027 or more likely, via American whalers. Compare English \u0027kanak\u0027 and French \u0027kanak\u0027 or \u0027\u0027 (canaque) Austrian German \u0027kanake\u0027 {{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Canadian\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, James Edward Alexander, \u0027[http://books.google.com/books?id\u003dNepo1_TMijUC L\u0027Acadie; or, Seven Years\u0027 Explorations in British America]\u0027, v 1, London: Henry Colburn, pp 272‚Äì3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We saw a few partridges: we also met a lusty fellow in a forest road with a keg of whisky slung round him, who called to us ‚ÄòCome boys and have some grog, I\u0027m what you call a \u0027\u0027canuck\u0027\u0027:‚Äô a (Canadian\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A Canadian, especially a French Canadian\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1835\u0027\u0027, Henry Cook Todd, \u0027Notes Upon Canada and the United States\u0027, p 92\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Jonathan distinguishes a Dutch or a French Canadian, by the term \u0027\u0027\u0027Kanuk\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, John G. Donkin, \u0027Trooper and Redskin in the Far North-West: Recollections of Life in the North-West Mounted Police, Canada, 1884-1888\u0027, Sampson Low, Marston, Searle, \u0026amp; Rivington, p¬†148\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It is a pity these Canadian militiamen spoilt the good work they had done by never-failing bluster. But for pure and unadulterated brag I will back the lower-class \u0027\u0027Canuck\u0027\u0027 against the world. The Yankee is a very sucking dove compared to his northern neighbour\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The French-Canadian dialect\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, ‚ÄúSong of the Men o\u0027 the Ax: Verse Stories of the Plain Folk Who Are Keeping Bright the Old Home Fires Up in Maine‚Äù, in \u0027Kin o\u0027 Ktaadn\u0027, p¬†145\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"On the deacon-seat in the leapin\u0027 heat¬†/ With the corn-cobs drawin\u0027 cool and sweet,¬†/ And timin\u0027 the fiddle with tunkin\u0027 feet,¬†/ A hundred men and a chorus.¬†/ ‚ÄúRoule, roulant, ma boule roulant,‚Äù¬†/ all \u0027\u0027Canuck\u0027\u0027 but a good song;¬†/ Lift it up then, good and strong,¬†/ for a cozy night\u0027s before us\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A thing from Canada\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027: \u0027Grip\u0027 (Toronto), 19 February, p¬†3\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Who\u0027ll buy my caller herrin\u0027?¬†/ Cod, turbot, ling, delicious herrin\u0027,¬†/ Buy my caller herrin\u0027,¬†/ They\u0027re every one \u0027\u0027Kanucks\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A Canadian pony or horse\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1860\u0027\u0027, Josiah Gilbert Holland, \u0027Miss Gilbert\u0027s Career: An American Story\u0027, p 25\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll sit here and blow till he comes round with his old go-cart, and then I\u0027ll hang on to the tail of it, and try legs with that little \u0027\u0027Kanuck\u0027\u0027 of his\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A member of the professional NHL ice hockey team\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The fighter-interceptor\", \"priority\":19}]}, \"synonyms\":{}}");

