	add("canvas", "{\"term\":\"canvas\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman from \u0027canevas\u0027 (compare Old French \u0027chanevas\u0027 \u0027chenevas\u0027 from a root ultimately derived from Latin \u0027cannabis\u0027 possibly a *\u0027cannabƒÅceus\u0027 or *\u0027cannapƒÅceus\u0027. Compare French \u0027canevas\u0027 resulting from a blend of the Old French and a Picard dialect word, itself from Old Northern French.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of coarse cloth, woven from hemp, useful for making sails and tents or as a surface for paintings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, James Edwin Thorold Rogers, \u0027A History of Agriculture and Prices in England\u0027, Volume 4, p. 556\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The term \u0027\u0027canvas\u0027\u0027 is very widely used, as well to denote the coarse fabrics employed for kitchen use, as for strainers, and wraps for meat, as for the best quality of ordinary table and shirting linen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A piece of canvas cloth stretched across a frame on which one may paint\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A basis for creative work\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The author takes rural midwestern life as a \u0027\u0027canvas\u0027\u0027 for a series of tightly woven character studies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A region on which graphics can be rendered\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"sails in genera\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A tent\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He spent the night under \u0027\u0027canvas\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A painting, or a picture on canvas\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Light, rich as that which glows on the \u0027\u0027canvas\u0027\u0027 of Claude\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A rough draft or model of a song, air, or other literary or musical composition; especially one to show a poet the measure of the verses he is to make\", \"priority\":14}]}, \"synonyms\":{}}");

